import React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { Button, CardActionArea, CardActions } from "@mui/material";
import background from "./2.jpg";
import { useLocation } from "react-router";

export default function ServiceUser() {
  const location = useLocation();
  const temp = JSON.parse(localStorage.getItem(location.state.service));
  const temp2 = temp[temp.length - 1];

  return (
    <div
      style={{
        backgroundImage: `url(${background})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "100% 100%",
        height: "100vh",
        width: "100%",
      }}
    >
      {" "}
      <Card
        sx={{
          maxWidth: 445,
          maxHeight: 300,
          paddingTop: 3,
          position: "relative",
          top: "20%",
          left: "40%",
        }}
      >
        <CardActionArea>
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              Name : {temp2.name}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              <h3>
                {" "}
                Mobile : {temp2.mobile} <br />
                Price : {temp2.price} <br />
                Service : {location.state.service}
              </h3>
            </Typography>
          </CardContent>
        </CardActionArea>

        <CardActions>
          <Button size="large" color="primary">
            Edit Details
          </Button>
        </CardActions>
      </Card>
    </div>
  );
}
